 Since $AB$ is congruent to $BD$, $BD$ is also congruent to $BC$, so $ABCD$ is a rhombus. Since the side length of the rhombus is 2, it is also a square. Because $\angle ABC$ is a right angle, we draw in the diagonal $\overline{AC}$
[asy]
draw((0,0)--(20,0)--(20,20)--(0,20)--cycle);
draw((0,0)--(20,20));
draw((0,0)--(20,0));
draw((0,0)--(10,0)--(10,10)--(0,10)--cycle);
draw((20,0)--(10,0)--(10,10)--(20,10)--cycle);
draw((0,20)--(10,20)--(10,10)--(0,10)--cycle);
