draw((10,10)--(10,20));
[/asy]This divides the rhombus into $4$ squares. There are $\binom{4}{2}=6$ ways to choose the $2$ $1\times 1$ squares that will be divided in two of the colors. This gives the answer of $\boxed{6}$. The answer is 6

